import  ReactDOM  from 'react-dom';
import React from 'react';
import './sudoku.css'
let ans=[]
let util;
function sudoku()
{
let row=[]
let col=[]
let box=[]
let getbox=[]
for(let i=0;i<10;i++)
  {
    ans[i]=[]
    row[i]=[]
    col[i]=[]
    box[i]=[]
    getbox[i]=[]
  }
for(let i=0;i<10;i++)
  {
    for(let j=0;j<10;j++)
      {
        //ans[i][j]=-1;
        row[i][j]=0;
        col[i][j]=0;
        box[i][j]=0;
        getbox[i][j]=-1;
      }
  }
let a=0;
for(let i=0;i<10;i++)
  {
    for(let j=0;j<10;j++)
      {
        if(j==6)
          a++;
        else if(j==3)
          a++;
        getbox[i][j]=a;
      }
    if(i<=1)
      a=0;
    else if(i<=4)
      a=3
    else
      a=6;
  }

function generate( i, j)
{
  if(i==9)
  {
    return 1;
  }
  let avail=[]
  let b=getbox[i][j]
  for(let k=1;k<10;k++)
    {
      if(row[i][k]==0 && col[j][k]==0 && box[b][k]==0)
        avail.push(k)
    }
  for(let k=0;k<avail.length;k++)
    {
      let a=-1
      let ind;
      while(a==-1)
        {
          a=Math.floor(Math.random()*avail.length);
          ind=a
          a=avail[a]
        }
      ans[i][j]=a
      //avail[a]=-1;
      row[i][a]=1;col[j][a]=1;box[b][a]=1;
      if(j==8)
      {
        if(generate(i+1,0)==1)
          return 1;
      }
      else
      {
        if(generate(i,j+1)==1)
          return 1;
      }
      row[i][a]=0;col[j][a]=0;box[b][a]=0;
      avail[ind]=-1
    }
  return 0;
}
generate(0,0)
util=JSON.parse(JSON.stringify(ans));
let i=0;
while(i<20)
  {
    let row=Math.floor(Math.random()*9)
    let col=Math.floor(Math.random()*9)
    if(util[row][col]!=-1)
    {
      i++;
      util[row][col]=-1;
    }
  }
}
sudoku();
export class Sudoku extends React.Component{

    render(){
        return (
            <div className="Sudoku">
            {util.map((row,index)=><Row arr={row} r={index}/>)}
            </div>
        )
    }
}
class Row extends React.Component{
   constructor(props){
    super(props)
   }
    render(){
        return (
            <div className="row">
                {this.props.arr.map((ele,index)=>{
                    if(ele===-1)
                    return <Input />
                    else
                    return <Element val={ele}/>
                })}
            </div>
        )
    }
}
class Element extends React.Component{
   constructor(props){
    super(props);
   }
     render(){
        return (
            <div className="Element">
                {this.props.val}
            </div>
        )
     }
}
class Input extends React.Component{

    render(){
        return (
                <input type="text" className='Element1'/>
        )
    }
}
